&lt;p&gt;दो कथनों के बाद I, II और III से अंकित तीन निष्कर्ष दिए गए हैं। दिए गए कथनों को सत्य मानते हुए, भले ही वे ज्ञात तथ्यों से अलग प्रतीत होते हों, तय कीजिये कि कौन सा/कौन से निष्कर्ष कथनों का तार्किक रूप से अनुसरण करता है/करते हैं।&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;कथन:&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;कुछ बढ़ई तकनीशियन हैं।&lt;/p&gt;

&lt;p&gt;सभी तकनीशियन मिस्त्री हैं।&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;निष्कर्ष:&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;I. कुछ बढ़ई मिस्त्री हैं।&lt;/p&gt;

&lt;p&gt;II. कुछ मिस्त्री तकनीशियन हैं।&lt;/p&gt;
III. सभी बढ़ई मिस्त्री हैं।

